measurements.description:
One flower on one 22-cm inflorescence on a single growth plant; 
	dorsal sepal white striped bright green; 
	synsepal light green striped bright green; 
	petals hirsute, ivory striped green, fading distally, translucent stripe lower half, warts upper half; 
	pouch pale green, veined green; staminode pale green tessellated dark green centrally; 

	substance firm; texture waxy.
